import React, { Component } from 'react';
import Main from './components/Main';
import 'bootstrap/dist/css/bootstrap.min.css';
var API_KEY='';
class App extends Component {
	componentWillMount(){
		API_KEY=process.env.REACT_APP_WOW_API_KEY
	}

  render() {
    return (
      <Main API_KEY={API_KEY}/>
    );
  }
}

export default App;
